import Expenses from "./components/Expenses/Expenses"
import NewExpence from "./components/NewExpense/NewExpense";
import ExpensesFilter from "./components/ExpenseFilter/ExpenseFilter";

const expenses =
  [
    {
      id: 'e1',
      title: 'Toilet Paper',
      amount: '294.32',
      date: new Date(2021, 4, 28)
    },

    {
      id: 'e2',
      title: 'NewTV',
      amount: '234.32',
      date: new Date(2021, 3, 28)
    },

    {
      id: 'e3',
      title: 'Car Insurance',
      amount: '42.32',
      date: new Date(2031, 2, 5)
    },

    {
      id: 'e4',
      title: 'Meal',
      amount: '65.32',
      date: new Date(2011, 2, 28)
    }
  ]

let App = () => {
  const saveExpenceHandler=expense=>{
    console.log("in App.js")
    console.log(expense)
  }

  return (
    <div>  
      <ExpensesFilter/>
      <NewExpence onSaveExpence ={saveExpenceHandler}/>
      <Expenses expenses={expenses}/>
    </div>
  );

}

export default App


